column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli accetta, per la configurazione, sia dati JSON diretti sia il nome di un file contenente la configurazione. Nel secondo caso, il file viene letto e il contenuto caricato in questa proprietà.

Esempi: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
        set team.config /etc/mio-team.conf

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Uso: nmcli device set { ARGOMENTI| help }

ARGOMENTI   := DISPOSITIVO { PROPRIETÀ [ PROPRIETÀ... ] }
DISPOSITIVO := [ifname] <ifname> 
PROPRIETÀ   := { autoconnect { yes | no } |
               { managed { yes | no }

Modifica le proprietà del dispositivo.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Uso: nmcli general { COMANDO | help }

COMANDO := { status | hostname | permissions | logging }

  status

  hostname [<nomehost>]

  permissions

  logging [level <livello registrazione>] [domains <domini registrazione>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Uso: nmcli general status { help }

Mostra lo stato generale di NetworkManager.
L'azione predefinita è «status»: «mmcli gen» equivale a «mmcli gen status»

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Uso: nmcli networking { COMANDO | help }

COMANDO := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Uso: nmcli radio { COMANDO | help }

COMANDO:= { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Uso: nmcli radio all { ARGOMENTI | help }

ARGOMENTI := [on | off]

Ottiene lo stato di tutti gli interruttori radio o li attiva/disattiva.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Uso: nmcli radio wifi { ARGOMENTI | help }

ARGOMENTI := [on | off]

Ottiene lo stato dell'interruttore Wi-Fi o lo attiva/disattiva.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Uso: nmcli radio wwan { ARGOMENTI | help }

ARGOMENTI := [on | off]

Ottiene lo stato dell'interruttore banda larga mobile o lo attiva/disattiva.
